import React, { useRef } from 'react';
import CreateIcon from '@mui/icons-material/Create';

export default function FocusToBarOnButtonClick({ todoTextRef }) {
  function focusInputField() {
    if (todoTextRef && todoTextRef.current) {
      todoTextRef.current.focus();
      console.log("Focusing on input field");
    }
  }

  return (
    <div>
      <button className='cornerButton' onClick={focusInputField}>
        <CreateIcon />
      </button>
    </div>
  );
}
